(function(){"use strict";const sel=(a,b=document)=>{return b.querySelector(a)}
const all=(a,b=document)=>{let t=[];for(let e of b.querySelectorAll(a)){t.push(e)}
return t}
const addEvt=(a,b,c)=>{if(typeof a==='string'){a=all(a);for(let e of a){e.addEventListener(b,c)}}else if(Array.isArray(a)){for(let e of a){e.addEventListener(b,c)}}else{a.addEventListener(b,c)}};const loaded=(a)=>{addEvt(document,'DOMContentLoaded',a)};window.sel=sel;window.all=all;window.addEvt=addEvt;window.loaded=loaded}())